        \\n\\nDesire is the seventeenth studio album by American singer-songwriter
        Bob Dylan, released on January 5, 1976 by Columbia Records.\\nIt is one of
        Dylan's most collaborative efforts, featuring the same caravan of musicians
        as the acclaimed Rolling Thunder Revue tours the previous year (later documented
        on The Bootleg Series Vol. 5). Many of the songs also featured backing vocals
        by Emmylou Harris and Ronee Blakley. Most of the album was co-written by Jacques
        Levy, and is composed of lengthy story-songs, two of which quickly generated
        controversy: the 11-minute-long \\\"Joey\\\", which is seen as glorifying
        the violent gangster \\\"Crazy Joey\\\" Gallo, and \\\"Hurricane\\\", the
        opening track that tells a passionate account of the murder case against boxer
        Rubin Carter, whom the song asserts was framed. Carter was released in 1985,
        after a judge overturned his conviction on appeal.\\n\\nA well-received follow-up
        to Blood on the Tracks, Desire reached No.?1 on the Billboard Pop Albums chart
        for five weeks, becoming one of Dylan's bestselling studio albums, and was
        certified double Platinum; the album reached No.?3 in the UK. It claimed the
        No.?1 slot on NME Album of the Year. Rolling Stone named Desire No.?174 on
        its list of The 500 Greatest Albums of All Time. It was voted number 761 in
        the third edition of Colin Larkin's All Time Top 1000 Albums (2000)\\n\\nPersonnel\\nBob
